import React from "react";
import styled from "styled-components";
import Profile from "./Profile";
const Wrapper = styled.section`
  display: flex;
  flex: 1 1;
  height: 400vh;
  width: 100%;
`;
const Spacer = styled.section`
  display: block;

  height: 20vh;
  width: 100%;
`;

const home = (props) => {
  return <Wrapper></Wrapper>;
};

export default home;
